import './App.scss';
import {BrowserRouter, Route} from "react-router-dom";
import Header from "./components/header/header";
import Routes from "./config/Routers";
import Footer from "./components/footer/footer";

function App() {
  return (
    <BrowserRouter>
      <Route render={props => (
          <>
            <Header {...props}/>
            <Routes/>
            <Footer/>
          </>
      )}/>
        <Footer/>
    </BrowserRouter>
  );
}

export default App;
